
import textwrap

def merge_the_tools(string, k):
    n = len(string) // k
    text_wrap = textwrap.wrap(string, n)
    result_list = text_wrap
    u = []
    cycle_length = len(result_list) // n
    
    for i in range(n):
        part_str = ""
        for index in range(cycle_length):
            cycle_str=result_list[i * cycle_length + index]
            for c in cycle_str:
                if c not in part_str:
                    part_str += c
        u.append(part_str)
    
    for item in u:
        print(item)
        


merge_the_tools("""""", 1246)

